import React from 'react';
import { FileText } from 'lucide-react';

const LoadingSpinner = ({ size = 'large', text = 'Loading...', fullScreen = true }) => {
  const getSpinnerSize = () => {
    switch (size) {
      case 'small':
        return 'w-4 h-4';
      case 'medium':
        return 'w-8 h-8';
      case 'large':
        return 'w-12 h-12';
      default:
        return 'w-8 h-8';
    }
  };

  const getContainerClasses = () => {
    if (fullScreen) {
      return 'fixed inset-0 bg-white/90 backdrop-blur-sm flex items-center justify-center z-50';
    }
    return 'flex items-center justify-center p-4';
  };

  return (
    <div className={getContainerClasses()}>
      <div className="text-center">
        {/* Animated Logo */}
        <div className="relative mb-4">
          <div className="animate-pulse">
            <div className="w-16 h-16 bg-gradient-to-r from-[#1A2A80] to-[#3B38A0] rounded-xl flex items-center justify-center mb-4 mx-auto">
              <FileText className="w-8 h-8 text-white" />
            </div>
          </div>
          
          {/* Spinning ring */}
          <div className="absolute inset-0 flex items-center justify-center">
            <div className={`${getSpinnerSize()} border-2 border-[#B2B0E8] border-t-[#1A2A80] rounded-full animate-spin`}></div>
          </div>
        </div>

        {/* Loading text */}
        {text && (
          <div>
            <p className="text-lg font-semibold text-gray-900 mb-2">{text}</p>
            <div className="flex items-center justify-center space-x-1">
              <div className="w-2 h-2 bg-[#1A2A80] rounded-full animate-bounce" style={{ animationDelay: '0ms' }}></div>
              <div className="w-2 h-2 bg-[#3B38A0] rounded-full animate-bounce" style={{ animationDelay: '150ms' }}></div>
              <div className="w-2 h-2 bg-[#7A85C1] rounded-full animate-bounce" style={{ animationDelay: '300ms' }}></div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

// Inline spinner for buttons and small spaces
export const InlineSpinner = ({ size = 'small', className = '' }) => {
  const getSpinnerSize = () => {
    switch (size) {
      case 'small':
        return 'w-4 h-4';
      case 'medium':
        return 'w-6 h-6';
      default:
        return 'w-4 h-4';
    }
  };

  return (
    <div className={`${getSpinnerSize()} border-2 border-current border-t-transparent rounded-full animate-spin ${className}`}></div>
  );
};

// Skeleton loader for content
export const SkeletonLoader = ({ lines = 3, className = '' }) => {
  return (
    <div className={`animate-pulse ${className}`}>
      {Array.from({ length: lines }, (_, i) => (
        <div
          key={i}
          className={`h-4 bg-gray-200 rounded ${
            i === lines - 1 ? 'w-3/4' : 'w-full'
          } ${i > 0 ? 'mt-2' : ''}`}
        ></div>
      ))}
    </div>
  );
};

// Card skeleton loader
export const CardSkeleton = ({ count = 1 }) => {
  return (
    <>
      {Array.from({ length: count }, (_, i) => (
        <div key={i} className="bg-white rounded-xl border border-gray-200 p-6">
          <div className="animate-pulse">
            <div className="flex items-start justify-between mb-4">
              <div className="w-8 h-8 bg-gray-200 rounded"></div>
              <div className="w-4 h-4 bg-gray-200 rounded"></div>
            </div>
            <div className="h-4 bg-gray-200 rounded mb-3"></div>
            <div className="space-y-2">
              <div className="h-3 bg-gray-200 rounded w-1/2"></div>
              <div className="h-3 bg-gray-200 rounded w-1/3"></div>
            </div>
          </div>
        </div>
      ))}
    </>
  );
};

export default LoadingSpinner;
